import React, { useState } from 'react';
import { Link } from 'react-router-dom';


function Navbar(useState) {
    return (
        <>
            <nav className="navbar">
                <div className="navbar-container">
                    <Link to="/" className="navbar-logo">
                        Test Logo
                    </Link>
                </div>
         </nav>
        </ >
    )
}

export default Navbar
